import React from 'react'

class NestStyle extends React.Component{

	render(){
		return (
			<div>
				
				<h1>hellow 内联!! </h1>
				<style jsx>{`
					h1 {
						color:orange;
					}
				`}</style>
			</div>
		)
	}
}

export default NestStyle
